import styled from 'styled-components';


export const Container = styled.div`
    width: 80px;
    height: 80px;
    background-color: #AAE09A;
`;

export const CategoryImage = styled.img`
    width: 50px;
    height: 50px;
    padding: 10px;
    border-radius: 10px; 
`;
